<script>
document.getElementById("form").addEventListener("submit", async function(e) {
  e.preventDefault();
  const pwd = document.getElementById("pwd").value;
  const encB64 = document.getElementById("enc-data").textContent;

  try {
    // Convert base64 to binary
    const encBytes = Uint8Array.from(atob(encB64), c => c.charCodeAt(0));

    // OpenSSL format: "Salted__" (8 bytes) + salt (8 bytes) + ciphertext
    const header = new TextDecoder().decode(encBytes.slice(0, 8));
    if (header !== "Salted__") throw new Error("Bad format");
    const salt = encBytes.slice(8, 16);
    const ciphertext = encBytes.slice(16);

    // Derive key + IV using EVP_BytesToKey equivalent (PBKDF2 with openssl -pbkdf2)
    // OpenSSL pbkdf2 uses PBKDF2-HMAC-SHA256 to derive key(32) + iv(16)
    const keyMaterial = await crypto.subtle.importKey(
      "raw", new TextEncoder().encode(pwd), "PBKDF2", false, ["deriveBits"]
    );
    const derived = await crypto.subtle.deriveBits(
      { name: "PBKDF2", salt: salt, iterations: 100000, hash: "SHA-256" },
      keyMaterial, (32 + 16) * 8
    );
    const keyBytes = new Uint8Array(derived.slice(0, 32));
    const ivBytes = new Uint8Array(derived.slice(32, 48));

    // Import AES key
    const aesKey = await crypto.subtle.importKey(
      "raw", keyBytes, { name: "AES-CBC" }, false, ["decrypt"]
    );

    // Decrypt
    const decrypted = await crypto.subtle.decrypt(
      { name: "AES-CBC", iv: ivBytes }, aesKey, ciphertext
    );

    const html = new TextDecoder().decode(decrypted);
    document.open();
    document.write(html);
    document.close();
  } catch (err) {
    document.getElementById("err").style.display = "block";
    document.getElementById("pwd").value = "";
    document.getElementById("pwd").focus();
  }
});
</script>
